import React from 'react';
import './ProgramsDetail.css';

const StemProgram = () => {
  return (
    <div className="program-detail">
      <div className="program-hero" style={{ backgroundImage: `url('https://images.unsplash.com/photo-1560785496-3c9d27877182?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80')` }}>
        <div className="hero-overlay"></div>
        <div className="hero-content">
          <h1>STEM Program</h1>
          <p>Advanced science, technology, engineering, and mathematics curriculum designed to challenge and inspire students.</p>
        </div>
      </div>
      <div className="program-content">
        <h2>About STEM Program</h2>
        <p>Our STEM program focuses on hands-on learning, critical thinking, and problem-solving skills. Students engage in projects that prepare them for careers in science, technology, engineering, and mathematics.</p>
        <img src="https://images.unsplash.com/photo-1523050854058-8df90110c9f1?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80" alt="STEM Program" />
      </div>
    </div>
  );
};

export default StemProgram;
